import React, { useState } from 'react';

const Search = () => {
    const [text, setText] = useState('');

    return (
        <section>
            <form>
                <input type='text' 
                className='form-control' 
                placeholder='Search characters ...' 
                value={text}
                onChange={(ev) => setText(ev.target.value)}
                autoFocus
                />
            </form>
        </section>
    )
}

export default Search;
